import React from "react";

const Page = ({ image }) => {
  return (
    <div className="container" sx={{ width: "100%", position: "relative" }}>
      <div className="invisible" sx={{ width: "100%", pb: "55%" }} />
      <img
        sx={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          objectFit: "cover",
          objectPosition: "center center"
        }}
        src={image.svg}
      />
      <img
        sx={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          objectFit: "cover",
          objectPosition: "center center"
        }}
        src={`/images/${image.webp}.webp`}
      />
      <style jsx>{`
        .container {
          width: 100%;
          position: relative;
        }

        .invisible {
          width: 100%;
          paddingbottom: 55%;
        }

        img {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
        }
      `}</style>
    </div>
  );
};

export async function getStaticProps() {
  const image = await getUnsplashImage();

  return {
    props: {
      image
    }
  };
}

export default Page;
